module.exports={
    "spac_prison": {
        "img_src": "../assets/fjetorja.jpg",
        "title": "Spac Prison",
        "description": "<p>E gjendur n krahinn e varfr dhe pak t populluar t Mirdits, n veri t Shqipris, lugina shkmbore e Spait sht jashtzakonisht e largt, gati vetvetiu nj burg. Gjat viteve 1960, autoritetet komuniste duke marr shkas dhe nga ky izolim ndrtuan atje nj burg sipas modelit stalinist t gulagve - kushte t vshtira atmosferike t ndrthurura me pun t detyrueshme n minier.</p>",
        "place": "<p>E gjendur n krahinn e varfr dhe pak t populluar t Mirdits, n veri t Shqipris, lugina shkmbore e Spait sht jashtzakonisht e largt, gati vetvetiu nj burg. Gjat viteve 1960, autoritetet komuniste duke marr shkas dhe nga ky izolim ndrtuan atje nj burg sipas modelit stalinist t gulagve - kushte t vshtira atmosferike t ndrthurura me pun t detyrueshme n minier.</p><p>Burgu u ndrtua mbi terracimet e nj shpati mali. Mbi t gjendeshin pes hyrje minierash, secila n lartsi t ndryshme. Dy ndrtesat e qelive dhe ato mbshtetse u ndrtuan mbi nj platform t improvizuar me pamje nga lumi. Ky grup ndrtesash formonte brthamn e kompleksit, me hyrjen kryesore nga ana jugore. Pr shkak t izolimit t burgut dhe terrenit t vshtir, rrethimi i perimetrit me mur nuk ishte i nevojshm. N vend t tyre kishte gardhe telash me gjemba, t pajisura gjithashtu me vendroje t posame. Gardhet rrethonin gjith territorin prreth, pr tu bashkuar tek hyrja kryesore. Pikrisht jasht ksaj hyrjeje ndodhej ndrtesa e administrats s burgut. M tutje n drejtim t jugut, prgjat rrugs, gjendeshin dy godina m t larta ku strehohej stafi teknik i miniers dhe burgut, bashk me familjet e tyre.</p>",
        "history": "<p>Prpara vitit 1968, Shqipria komuniste kishte dy lloje burgjesh; burgje izolimi dhe kampe pune t detyrueshme. Spai i bnte bashk t dy tipet nn emrin Reparti 303 I Riedukimit, Spa. Ashtu si n vende t tjera komuniste, shum nga t burgosurit ishin t dnuar pr arsye politike. Muzeu Historik Kombtar n Tiran ka prllogaritur se regjimi komunist mbante t burgosur pr arsye politike 50,000 njerz, n nj sistem prej 23 burgjesh dhe 48 kampesh internimi. Me nj kapacitet maksimal prej 1400 vetsh, Spai ishte vetm nj nga ingranazhet e makineris s madhe t shtypjes, por kushtet njerzore t miniers dhe profili i lart i shum prej t burgosurve politik t kampit, shumica e t cilve ishin intelektual, i dha atij nj rndsi t madhe simbolike. </p><p>Nj episod i qndress s br n kt burg ferri, vazhdon t mbetet n kujtesn kolektive, Revolta e Spait. N datat 21-23 maj, 1973, t burgosurit e Spait morn kontrollin e burgut gjat nj revolte t prgjithshme. Kjo sht nj nga ngjarjet kulmore t ktij vendi. Dy ishin faktort q nxitn shprthimin e revolts n at ast t caktuar. I pari ishte fryma m liberale q karakterizoi nj periudh fare t shkurtr, fillimin e viteve 70-t, pr tu denoncuar dhe goditur rnd nga Partia Komuniste vetm pak koh m pas. Faktori tjetr ishin kushtet mesjetare t puns n minier. T burgosurit punonin me or t zgjatura nntok, punonin me duar, n nj nxehtsi sfilitse q mund t arrinte 40 gradt, me mushkrit e bllokuara nga pluhuri dhe tymi toksik. Edhe pse regjimi komunist prsriste slloganin Njeriu sht kapitali m i muar, ai zhvlersonte njerzit q ai vet detyronte t skllavroheshin n miniera. T burgosurit e mbajtn kontrollin e kampit pr dy dit, duke ngritur flamurin shqiptar pa yllin komunist (flamurin q prdoret sot nga Shqipria) dhe duke thirrur njzri fraza t ndaluara si: Ne jemi me Evropn e lir!, Liri a vdekje! dhe Posht komunizmi!. T shumt jan ata q e konsiderojn kt t Spait si nj nga revoltat politike m me ndikim kundr diktaturs komuniste n Shqipri. Pas shtypjes s revolts, drejtuesit e saj u ekzekutuan dhe t tjert morn dnime edhe m t rnda, por ngjarja arriti ti siguronte Spait nj vend t rndsishm n imagjinatn kolektive t vendit.</p>",
        "today": "<p>Spai sht n gjendje t keqe konservimi, aq sa sht e vshtir pr nj vizitor t kuptoj se aty ka qn dikur nj burg. N fillimin e viteve 1990, mbyllja e kampit t puns s detyrueshme i parapriu mbylljes s vet burgut, trsisht i braktisur q prej 1995. Q ather ai ka psuar shkatrrim, plakitje dhe indiferenc. N vitin 2007 Spai u shpall Monument Kulture (dhe sot mbetet ende i vetmi monument q lidhet drejtprdrejt me periudhn e represionit komunist) duke synuar shndrrimin e tij n muze. Por pavarsisht ksaj, shkatrrimi i tij nuk ka pasur t ndalur. N vitin 2015 nj kompani private ka filluar rishfrytzimin e miniers dhe punimet e kryera n kt kuadr kan dmtuar n mnyr t pakthyeshme nj pjes t rndsishme t ish-kampit  rrnojat e barrakave ku u vendosn n fillim t burgosurit e par politik n Spa jan zhdukur nga pejsazhi pr ti ln vnd infrastrukurs dhe ndrtesave t reja t miniers. N vitin 2016 Ministria e Kulturs (MK) prcaktoi dhe zonn e mbrojtur t monumentit ish-burgu i Spait, nj prgjigje kjo edhe ndaj tendencs n rritje t industralizimit t t gjith asaj zone.</p><p>N 2017, CHwB Albania me ndihmn e Suedis, kreu ndrhyrje emergjente konsolidimi n ndrtesat e mbetura n Spa, pr t zbutur, n nj perspektiv afat-skurtr, rrezikun e shmbjes s tyre t plot. Paralelisht, CHwB ka ndrmarr dhe inisiativa n nj kuadr m afat-gjat si pr shembull, dokumentimi dhe komunikimi rreth ndryshimeve q ka psuar Spai nprmjet analizs s dokumentave arkivor, puna me ish t burgusor politik n Spa, etj. Fal ksaj pune dhe duke u mbshtetur dhe nj proces novator planifikimi gjithprfshirs (me palt e ndryshme t interesit dhe prdoruesit e ardhshm t Spait si, ish t prndjekurit politik, banort vendas, msuesit e historis, operatort turistiks, diplomatt, gjimnazistt, studentt e gazetaris/trashgimis kulturore, profesionistt e muzeve, aktivistt pr t drejtat e njeriut, profesionistt ndrkombtar t kujtess, etj.), CHwB Albania ka prpiluar nj koncept gjithprfshirs muzealizimi q do t udhheq prpjekjet e ardhshme pr ruajtjen e ish-burgut. N vitin 2018, MK dhe CHwB Albania kan nnshkruar nj marrveshje bashkpunimi mbi bazn e ktij koncepti dhe punojn aktualisht pr t gjetur mbshtetjen e nevojshme pr fillimin e procesit. </p>"
    },
    "methodology": {
        "img_src": "../assets/Methodology.jpg",
        "title": "Methodology",
        "description": "<p>Ajo q do t doja un tu prohej brezave sht kujtesa e asaj se si gjrat mund t shkojn keq kur varesh nga nj sistem q bhet kriminal n vetveteFabian Kati, ish- i burgosur politik n Spa nga 1984-86.</p><p>Teknika e rindrtimit digjital sht mjaft intersante n rastin e Burgut t Spait, duke qn se largsia e tij dhe gjendja e keqe e konservimit kufizojn s teprmi potencialin e tij si nj memorial (pr t transmetuar tek brezat e rinj t kujtesn e s shkuars s vshtir t Shqipris dhe pr t shrbyer si n platform pr biseda m konstruktive rreth saj).</p>",
        "document": "<p>Ajo q do t doja un tu prohej brezave sht kujtesa e asaj se si gjrat mund t shkojn keq kur varesh nga nj sistem q bhet kriminal n vetveteFabian Kati, ish- i burgosur politik n Spa nga 1984-86.</p><p>Teknika e rindrtimit digjital sht mjaft intersante n rastin e Burgut t Spait, duke qn se largsia e tij dhe gjendja e keqe e konservimit kufizojn s teprmi potencialin e tij si nj memorial (pr t transmetuar tek brezat e rinj t kujtesn e s shkuars s vshtir t Shqipris dhe pr t shrbyer si n platform pr biseda m konstruktive rreth saj).</p><p>N kto kushte prqasja jon pr t krijuar nj prototip rindrtimi digjital i bazuar n web, synon q prmes tij t rritet kurioziteti pr t vizituar kt vend, t mundsohet nj kuptim m i mir hapsinor dhe historik n lidhje me Spain, dhe q s fundmi t shtyj prdoruesin t mendoj n mnyr kritike n lidhje me kompleksitetin e qnies njerzore dhe ndrveprimin e saj me shjte thelbsore si liria (apo mungesa e saj), (pa)drejtsia, t (mos)rezistuarit ndaj shypjes. </p><p>Prototipi  prfshin rindrtimet 3d t godinave n zonn e burgut q jan ende n kmb, disa godina q sot nuk jan m, si dhe disa hapsira t rndsishme t ndrmjetme apo t lidhura me punn. Secila nga kto pika vjen n model e shoqruar me histori personale, fotografi panoramike apo fotografi t nxjerra nga arkivat, pr t hedhur kshtu pakz drit mbi nj dit t zakonshme si i dnuar politik n Spa. Prototipi prfshin gjithashtu nj model digjital t relievit prreth Spait, nj tipar ky shum i rndsishm pr prjetimin e tij.</p><p>Ringritja n 3D sht bazuar mbi projektin arkitektonik t zhvilluar nga CHwB Albania pr ndrhyrjet emergjente stabilizuese t ndrmarra n 2017. Modeli i terrenit u mundsua fal nj rilevimi 3D me dron nga GeoSat Group, ndrsa prototipi u ideua n bashkpunim me Institutin Politeknik t Universitetit, dhe u prmirsua me ndihmn e David Veliut dhe Stavri Picit. Zenel Drangu dhe Fabian Kati, ish t dnuar politik n Spa kontribuan me ekspertizn e tyre kye pr Spain. Atyre iu shtuan dhe dshmi nga zra t tjer po aq t rndsishm pr Spain. Drangu e udhhoqi ekipin e projektit n terren duke treguar n detaj histori q lidheshin me vendet e vizituara, ndrsa Kati i mundsoi intervistuesve nj analiz t plot t prototipit prmes kursorit. Paralelizmat mes shpjegimeve t ardhura nga kto dy rrug t ndryshme, vrtetuan se rindrtimi digjital mund t jet nj mjet risjelljes n kujtes, po aq efektiv sa dhe vet vizita n terren.</p><p>S fundmi ky prototip nuk ka pr synim t paraqes Burgun e Spait, n trsin  dhe kompleksitetin e tij prgjat 20 viteve shfrytzim e 30 viteve braktisje dhe neglizhim q pasuan. Pr nj rindrtim t plot digjital do t duheshin m shum dshmi, pr t mundsuar kshtu nj knvshtrim m t gjer historik, si dhe prpjekje t vazhdueshme modelizimi pr ta pasuruar prototipin ekzistues me m shum element t rindrtuar dhe kuptimplot.</p>"
    },
    "memorialization": {
        "img_src": "../assets/memorialization.jpg",
        "title": "Memorialization",
        "description": "<p>CHwB ka zhvilluar nj koncept t bazuar n dy ide kye:</p><p>1. Krijimi i nj vendi t sigurt pr dialog i cili iu ofron vizitorve hapsirat e prshtatshme dhe kontaktin me historit e t mbijetuarve, t cilat do t mundsojn t kuptuarit e mekanizmave individuale dhe kolektive q kan uar dhe mund t ojn srish tek e keqja m e madhe (proceset m t rrezikshme shoqrore).</p>",
        "document": "<p>CHwB ka zhvilluar nj koncept t bazuar n dy ide kye:</p><p>1. Krijimi i nj vendi t sigurt pr dialog i cili iu ofron vizitorve hapsirat e prshtatshme dhe kontaktin me historit e t mbijetuarve, t cilat do t mundsojn t kuptuarit e mekanizmave individuale dhe kolektive q kan uar dhe mund t ojn srish tek e keqja m e madhe (proceset m t rrezikshme shoqrore).</p><p>2. Kthimi i kujtess n veprim: kalimi nga t kujtuarit n t vepruarit krkon q Spai t ktheht n nj vektor edukimi qytetar,t ofruar n mnyr cilsore dhe t shumllojshme. Nse kauza q prfaqson ish-burgu kuptohet dhe prvetsohet nga breza t ndryshm dhe pr arsye t ndryshme, do t arrijm dhe tejkalojm si shoqri qllimin Kurr M. Si vend reflektimi, por edhe si vend kulturor me angazhim social, Spai do t lejoj dgjimin dhe marrjen n konsiderat t zrave t shumfisht. Jo vetm q do t mundsoj dialogun mes njerzve, por edhe dialogun mes t shkuars dhe s tashmes. Kjo do t lejoj vizitort t kontekstualizojn t tashmen dhe t veprojn n lidhje me shtje bashkkohore duke u bazuar n msimet e t shkuars.</p><p>Prqasja konservuese e przgjedhur sht ruajtja e burgut t Spait n gjendjen aktuale. Nj restaurim i plot i tij do t fshinte historin e braktisjes s tij, histori e cila reflekton tranzicionin post-komunist t Shqipris. Prpjekjet pr  konsolidimin e mtejshm q shkojn prtej ktij koncepti, do t sigurojn qndrueshmrin fizike afatgjat t Spait. Nprmjet ktij koncepti, Spai do t interpretohet pr vizitort dhe do t bhet i sigurt pr aktivitete q do t mbahen aty. Fokusi i vizits do t jet tek zona qendrore e ish-burgut, e cila do t shrbej si zon prkujtimore. Aty vizitori do vihet n kontakt t drejtprdrejt me historin e ndrlikuar t burgut t Spait dhe t atyre q e kan prjetuar at. Zona e Puntorve t lir do t ofroj funksionet mbshtetse, t cilat do ti bjn vizitort t reflektojn dhe t kuptojn se duhet t mbajn prgjegjsi individualisht pr gjendjen e demokracis n shoqrit e sotme.</p>"
    },
    "credits": {
        "document": "<p>Prototipi i Rindrtimit Digjital t Burgut t Spait u mundsua nga CHwB Albania dhe Instituti Politeknit I Uorsterit.</p><p>CHwB Albania ideoi dhe koordonoi projektin; ka mundsuar materialin mbshtets arkivor dhe arkitektonik, kontaktin me dshmitar dhe vizitat n terren, rilevimin 3d t terrenin, si dhe ka kshilluar gjat gjith procesit t ngritjes s prototipit dhe t zhvillimet web.</p><p>Instituti Politeknik i Uorsterit ka mundsuar ekspertizn teknike pr ngritjen e prototipit prmes prfshirjes s studentve Michael Clements, Leo Gross, Elizabeth Kirschner, and Zetta Rajaniemi dhe profesorve Robert Hersh dhe Robert Kinicki.</p>"
    }
}
