        "about_memorialization_button_1": "Koncepti i memorializimit",
        "about_credits_document": "<p>Prototipi i Rindrtimit Digjital t Burgut t Spait u mundsua nga CHwB Albania dhe Instituti Politeknik i Uorsterit.</p><p>CHwB Albania ideoi dhe koordonoi projektin; mundsoi materialin mbshtets arkivor dhe arkitektonik, kontaktin me dshmitar dhe vizitat n terren, rilevimin 3d t terrenit, si dhe ka kshilluar gjat gjith procesit pr ngritjen e prototipit dhe t zhvillimit prweb.</p><p>Instituti Politeknik i Uorsterit ka mundsuar ekspertizn teknike pr ngritjen e prototipit prmes prfshirjes s studentve Michael Clements, Leo Gross, Elizabeth Kirschner, Zetta Rajaniemi dhe profesorve Robert Hersh dhe Robert Kinicki dhe me mbshtetjen lokale nga Kristi Zoto.</p>",
