      "page_title": "Arrival  The first impression (FABIAN KATI)",
      "page_type": "photo_360",
      "story_title": "Arrival  The first impression (FABIAN KATI)",
      "story_content": "<p>My first impression of Spa was a mixed feeling: first you would look at the structures in Spa and you would be impressed from it...the landscape was also impressive and it would almost shock you. But  on the other side, considering the long road to get there, during which I was tied in the prison car, with the smell of vomiting and dirt and almost without fresh air... and considering as well that I was coming from almost a year of isolation...when I got there, I was under the open sky, you know? So, it was a kind of releaf, a very intimate sense of freedom: I was able to see the sky again... That was the mixture of these shocking structures that awaited for you and all those gates were impressive, the soldiers there, the controls and the fact of being let out of the car just in front of the Command building...and where the big entrance gate would close behind you, and with another set of gates opening just in front of you... </p><p>Interview with Fabian Kati, former political prisoner at Spa from 1984-86, </p><p>conducted by the authors, 2019.</p>",
