      "id": 12,
      "page_title": "The resentences mechanism",
      "page_type": "photo_360",
      "story_title": "The resentences mechanism ",
      "story_content": "<p>The resentences were a way to keep the pressure high, a massive mechanism of violence. When I first fell in prison, I was eagerly awaiting to be where I thought I could find freedom and where I could say everything. I thought I would find there friendly persons, with whom we shared the same ideals. Instead, the first thing I found there was fear and the terror of being resentenced. The prison was not as I had imagined it; it had also its own surveillance mechanisms. It was split among the good people and the people that were spies, with whom you shouldnt be hanging out as they could have you be resentenced. ()</p><p>In a certain way, for those of us who were resentenced while already being in prison, it felt like life imprisonment. Our only ray of hope was the fall of the regime, for if it didnt happen, we would still be locked inside. Absurd conversations would be heard: How many years were you charged? - 3 years! How many years have you served?  10 years!  How many years you have left?  15 years!</p><p>Adaptation from Albanian to English of an interview with Fatos Lubonja, political prisoner at <br/>Spa for 11 years. The interview was conducted in 2011 by Tv Klan. Available here (albanian only): http://perpjekja.blogspot.com/2011/06/ridenimi-intervista.html </p>",
