      "id": 24,
      "page_title": "The 1973 Revolt",
      "page_type": "photo_360",
      "story_title": "The 1973 Revolt",
      "story_content": "<p>One episode of resistance in this hellish prison continues to inhabit the public memorythe Spa revolt. From May 21-23, 1973, the prisoners at Spa took control of the prison in a general revolt. This event is one of the watershed moments in the history of the site. Two factors contributed  to the outbreak of revolt at this particular moment. One was a liberalizing movement that the Communist Party briefly encouraged in the early 1970s, only to retract and denounce it a short time later. The other was the medieval working conditions in the mine. Prisoners were subject to long hours underground, working by hand in stifling heat that could reach 40 degrees, their lungs clogged by toxic dust and fumes. Even as the Communist regime repeated  the slogan Man is the most precious capital, it dehumanized those it sent to work in the mines. </p><p>For two days, the prisoners held control of the camp, raising the Albanian flag without its Communist star (the flag used by Albania today) and shouting in unison such forbidden phrases as We are with Free Europe! Freedom or Death! and Down with Communism! Many consider this one of the most influential political revolts against Albanias Communist dictatorship. When the revolt was put down, its leaders were executed and the rest given harsher prison sentences, but the event succeeded in gaining Spa a place in the collective imagination of the country.</p>",
