      "id": 31,
      "page_title": "The roll-call",
      "page_type": "photo_360",
      "story_title": "The roll-call",
      "story_content": "<p>The roll-call would happen twice a day. In the morning it would be at 9 AM, per the regulations, and the afternoon would be a 5 PM. The problem was that we would be called up to the terrace, but the responsible guards would not come until one or two hours later to dispatch us to work. We would wait for one or two hours in the cold or the heat, with no option to react. The worst was for the prisoners who worked the third shift, who would end their shift at 8 AM. They would have to come here to get counted, so they would come here at 8 AM, and then wait an additional two or three hours to get counted. Then, they would go back and sleep only a few hours to wake up at 2PM for lunch. These were the unoffical rules we were exposed to, going well beyond the official regulations.</p><p>Adaptation from Albanian to English of the interview with Zenel Drangu, former political prisoner at <br/> Spa from 1974-89; interview conducted by the authors, 2019. </p>",
