      "id": 7,
      "page_title": "Zenels sleeping room",
      "page_type": "photo_360",
      "story_title": "Zenels sleeping room",
      "story_content": "<p>This is my room, where 54 people would sleep in it. On the sides of the room you had 10 beds and 3 levels so 30 people would sleep along the walls. And then you had an additional 6 beds here multiplied by 3 three levels. So 18 persons plus 30 is 48. And then here, there were double beds with 3 levels so its 6 additional persons. So 54 total persons. It was possible because there was only 60 cm of width, so you would need to sleep on your side, otherwise you would end up touching another person. So even sleeping was a kind of torture (...)</p><p>In the morning, at 5:00 a courier who would go around and tell everyone to get up. I created the habit of waking up a bit early, at about 4:45 to be able to go with a bit more comfort to the toilets to clean myself before I had to go to work. Because if you woke up later,  then you woul be with 300 other persons waiting in line to get access to the toilets, and there were only 10 water taps and 15 toilets that could be used.</p><p>Adaptation from Albanian to English of the interview with Zenel Drangu, former political prisoner at <br/>Spa from 1974-89; interview conducted by the authors, 2019.</p>",
